import React from "react";

const Navbar = ({ filterItem, menuList }) => {
  return (
    <>
      <div className="boxp"></div>
      <h1 className="line">Featured Movies</h1>
      <nav className="navbar">
        <div className="btn-group">

          {menuList.map((curElem) => {
            return (


              <button type="button" className="btn-group__item" onClick={() => filterItem(curElem)}>
              {curElem}         
              </button>
            );
          })}
        </div>
      </nav>
    </>
  );
};

export default Navbar;
